import './Navbar.css'
import React from 'react';

class Navbar extends React.Component {
  render () {
      return (
          <div>
            <nav className="navbar fixed-top navbar-light">
              <div className="container-fluid">
              <i className="fas fa-coins coin"></i>
                  Wes
              </div>
            </nav>
          </div>
      )
  }

}

export default Navbar
